using System;using C=System.Console; class Player{static void Main(string[] args){var i=C.ReadLine().Split(' ');var lX=int.Parse(i[0]);var lY=int.Parse(i[1]);var ix=int.Parse(i[2]);var iy=int.Parse(i[3]);var mX=lX-ix;var mY=lY-iy;while(true){C.ReadLine();if(mX>0){if(mY>0){mX-=1;mY-=1;C.WriteLine("SE");}else if(mY<0){mX-=1;mY += 1;C.WriteLine("NE");}else{mX-=1;C.WriteLine("E");}}else if(mX<0){if(mY>0){mX+=1;mY-=1;C.WriteLine("SW");}else if(mY<0){mX+=1;mY+=1;C.WriteLine("NW");}else{mX+=1;C.WriteLine("W");}}else{if(iy<lY){C.WriteLine("S");}else if(iy>lY){C.WriteLine("N");}}}}}